INSERT INTO `grades` (`id`, `name`, `description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Primary', '<p>&nbsp;Each of these devices has passed all key functional tests</p>', NULL, '2022-05-10 03:13:32', '2022-05-10 03:47:33'),
(2, 'Secondary', '<p>All devices in grades PGL/PCG/PLB have not been cosmetically graded and will vary in appearance. All units have:</p>\r\n\r\n<ul>\r\n	<li>No ID Lock</li>\r\n	<li>No Apple activation error</li>\r\n	<li>No iTunes Image</li>\r\n	<li>Good Touch ID</li>\r\n	<li>Clean ESN</li>\r\n</ul>', NULL, '2022-05-10 05:38:52', '2022-05-10 05:38:52');
INSERT INTO `grading_scales` (`id`, `name`, `grade_id`, `apperance`, `screen`, `bezel`, `other`, `functionality`, `lcd`, `entered_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'A1', 1, 'Flawless at first glance', 'Very few, if any, faint scratches only visible upon close inspection or viewing/rotating under light', '<p><strong>&nbsp;</strong>Very few, if any, minor blemishes only visible upon close inspection</p>\r\n\r\n<p>View examples below</p>', NULL, NULL, NULL, 1, NULL, '2022-05-11 00:52:05', '2022-05-11 00:52:05'),
(2, 'B1', 1, 'Excellent', 'Few, faint small scratches, only visible upon close inspection or viewing/rotating under light', '<p>Few, faint small blemishes only visible upon close inspection</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 05:32:25', '2022-05-19 05:32:25'),
(3, 'B2', 1, 'Lightly used', 'Few to several faint small scratches, only visible upon close inspection or viewing/rotating under light', '<p>&nbsp;Several blemishes (scratches, scuffs), visible upon quick inspection</p>\r\n\r\n<p>Compared to the B1 grade, the screen might show slightly more signs of use, and the housing will show more signs of use.</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 23:20:11', '2022-05-19 23:20:11'),
(4, 'C1', 1, 'Used', 'Numerous faint and a few more pronounced scratches visible upon quick inspection', '<p>Several blemishes (scratches, scuffs) visible upon quick inspection</p>\r\n\r\n<p>The screens on the C1 grade will show more signs of use compared to the B2 grade.</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 23:21:54', '2022-05-19 23:21:54'),
(5, 'C2', 1, 'Heavily used', 'Extensive, pronounced scratches, easily visible upon quick inspection', '<p>&nbsp;Extensive, pronounced blemishes (scratches, scuffs), easily visible upon quick inspection</p>', NULL, NULL, NULL, 1, NULL, '2022-05-19 23:23:47', '2022-05-19 23:23:47'),
(6, 'KFCG', 1, NULL, ' Working LCD  The device will have cracked glass on the front and/or back  A small percentage may have an LCD blemish', NULL, 'Devices have not been cosmetically graded and will vary in appearance.', NULL, NULL, 1, NULL, '2022-05-19 23:45:44', '2022-05-19 23:45:44'),
(7, 'KFLB', 1, NULL, ' Working LCD  The device will have a blemish on the LCD (white spot, yellow spot, burned image, discolored LCD, or halo)', NULL, 'Devices have not been cosmetically graded and will vary in appearance.', NULL, NULL, 1, NULL, '2022-05-19 23:47:02', '2022-05-19 23:47:02'),
(8, 'PGL', 2, NULL, 'No cracks', NULL, NULL, '<ul>\r\n	<li>&nbsp;Power on</li>\r\n	<li>&nbsp;Good LCD</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'No LCD blemish (see KFLB or PLB for definition of LCD blemish)', 1, NULL, '2022-05-19 23:52:05', '2022-05-19 23:52:05'),
(9, 'PCG', 2, NULL, 'The device will have cracked glass on the front and/or back', NULL, NULL, '<ul>\r\n	<li>Power on</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'Small percentage may have an LCD blemish (see KFLB or PLB for definition of LCD blemish)', 1, NULL, '2022-05-19 23:53:55', '2022-05-19 23:53:55'),
(10, 'PLB', 2, NULL, 'No cracks', NULL, NULL, '<ul>\r\n	<li>Power on</li>\r\n	<li>One or more non-key functions do not work</li>\r\n</ul>', 'LCD blemish (white spot, yellow spot, discolored LCD, burned image, or halo)', 1, NULL, '2022-05-19 23:55:16', '2022-05-19 23:55:16'),
(11, 'PID', 2, NULL, 'Cracks possible', NULL, NULL, '<ul>\r\n	<li>Power on</li>\r\n	<li>Facial recognition does not work</li>\r\n	<li>One or more non-key functions may not work</li>\r\n</ul>', 'LCD blemish possible (white spot, yellow spot, discolored LCD, burned image, or halo)', 1, NULL, '2022-05-19 23:57:51', '2022-05-19 23:57:51');
